import React from 'react';

// material-ui
import { Checkbox, FormControlLabel, Grid, MenuItem, TextField } from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';

const ClientCaseload = () => {
    const [city, setCity] = React.useState('1');
    const handleChangeCity = (event) => {
        setCity(event.target.value);
    };

    const [Country, setCountry] = React.useState('1');
    const handleSelectChange1 = (event) => {
        setCountry(event.target.value);
    };

    const [state1, setState1] = React.useState({
        checkedA: true
    });
    const handleChangeState1 = (event) => {
        setState1({ ...state1, [event.target.name]: event.target.checked });
    };
    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={12} sm={6}>
                <TextField type='number' fullWidth label='Number of Case Management Clients' defaultValue='' />
            </Grid>
            <Grid item xs={12} sm={6}>
                <TextField fullWidth label='Total time spent' defaultValue='' />
            </Grid>
            <Grid item xs={12} sm={6}>
                <TextField type='number' fullWidth label='Number of Regular Clients' defaultValue='' />
            </Grid>
            <Grid item xs={12} sm={6}>
                <TextField fullWidth label='Total time spent' defaultValue='' />
            </Grid>
        </Grid>
    );
};

export default ClientCaseload;
